VOID S1USessionManager::lockDnsMap()
{
	pthread_mutex_lock(&dnsSessionLock::lockCount);
	while (dnsSessionLock::count == 0)
		pthread_cond_wait(&dnsSessionLock::nonzero, &dnsSessionLock::lockCount);
	dnsSessionLock::count = dnsSessionLock::count - 1;
	pthread_mutex_unlock(&dnsSessionLock::lockCount);
}

VOID S1USessionManager::unLockDnsMap()
{
    pthread_mutex_lock(&dnsSessionLock::lockCount);
    if (dnsSessionLock::count == 0)
        pthread_cond_signal(&dnsSessionLock::nonzero);
    dnsSessionLock::count = dnsSessionLock::count + 1;
    pthread_mutex_unlock(&dnsSessionLock::lockCount);
}

S1USessionManager::S1USessionManager(int id) {
	this->_name = "S1USessionManager";
	this->setLogLevel(Log::theLog().level());

	this->instanceId = id;
	ipSMInterface		= new S1UInterface(id);
	minCount			= 0;
}

S1USessionManager::~S1USessionManager() {

	printf("\S1USessionManager [%d] shutting down\n",instanceId);
	delete(ipSMInterface);
}

BOOL S1USessionManager::isRepositoryInitialized()
{ return ipSessionMgrReadyState; }

VOID S1USessionManager::run()
{
	bool dnsDumpFlag = false;
	bool tcpSessionCleanFlag = false;

	int lastProcessedIndex = -1;
	int curIndex = -1;
	int curMin = 0, prevMin = 0;
	int curHour = 0, prevHour = 0;
	int curSecIdxSessionClnUp = 0 , prevSecIdxSessionClnUp = 0;

	if(instanceId == 0) {
		lockDnsMap();
			ipSMInterface->IPv4_DnsLoadLookUp();
//			ipSMInterface->IPv6_DnsLoadLoopUp();
		unLockDnsMap();
	}

	curMin = prevMin = IPGlobal::CURRENT_MIN;
	curHour = prevHour = IPGlobal::CURRENT_HOUR;

	curSecIdxSessionClnUp = prevSecIdxSessionClnUp = IPGlobal::CURRENT_SEC / IPGlobal::S1U_SESSION_CLEAN_UP_SCAN_FREQ_SEC;

	curIndex = PKT_READ_TIME_INDEX(IPGlobal::CURRENT_EPOCH_SEC, IPGlobal::PKT_TIME_INDEX);
	lastProcessedIndex = curIndex;

	ipSessionMgrReadyState = true;

	while(IPGlobal::S1U_SESSION_MANAGER_RUNNING_STATUS[instanceId])
	{
		usleep(50000);		// 100ms

		curMin = IPGlobal::CURRENT_MIN;
		curHour = IPGlobal::CURRENT_HOUR;

		curSecIdxSessionClnUp = IPGlobal::CURRENT_SEC / IPGlobal::S1U_SESSION_CLEAN_UP_SCAN_FREQ_SEC;

		curIndex = PKT_READ_TIME_INDEX(IPGlobal::CURRENT_EPOCH_SEC, IPGlobal::PKT_TIME_INDEX);

		while(lastProcessedIndex != curIndex)
		{
			usleep(25000);		// 100ms
			IP_ProcessQueue(lastProcessedIndex);
			lastProcessedIndex = PKT_READ_NEXT_TIME_INDEX(lastProcessedIndex,  IPGlobal::PKT_TIME_INDEX);
		}

		if(curSecIdxSessionClnUp != prevSecIdxSessionClnUp)
		{
			ipSMInterface->IPv4_TimeOutCleanIpSession();
			prevSecIdxSessionClnUp = curSecIdxSessionClnUp;
		}

		if(curMin != prevMin)
		{
			minCount++;
			ipSMInterface->IPv4_DnsTimeOutCleanSession();			// DNS Session Cleanup

			if(minCount > IPGlobal::LOG_STATS_FREQ_SEC)
			{
//				ipSMInterface->IPv4_IpSessionCount();				// ??? TND:: IP Session Count
//				ipSMInterface->IPv4_DnsSessionCount();				// ??? DNS Session Count

				if(instanceId == 0)
				{
					lockDnsMap();
					ipSMInterface->IPv4_DnsLookUpCount();			// ??? TNS :: DNS Lookup Map Size
//					ipSMInterface->IPv4_DnsDBClean();				// DNS Database Map Cleanup
//					ipSMInterface->IPv4_DnsDBCount();				// DNS Database Map Size
					unLockDnsMap();
//					ipSMInterface->logStunSysLogUserDnsMapSize();
				}
				minCount = 0;
			}
			prevMin = curMin;
		} /* End of Minutes Job */

		// Every Hour jobs now
		if(prevHour != curHour)
		{
			if(instanceId == 0)
			{
//				if(GContainer::config->OPERATOR_ID == TATASKYBB) {
//					lockSysLogMap();
//					ipSMInterface->TimeOutCleanSysLog(curHour);					// Syslog Map Cleanup
//					unLockSysLogMap();
//				}

				/* Every Day at 04 hour dump DNS data */
				if((IPGlobal::CURRENT_HOUR == IPGlobal::DNS_DUMP_HOUR) && (dnsDumpFlag == false))
				{
					ipSMInterface->IPv4_DnsDumpLkuInfo(IPGlobal::CURRENT_DAY);			// Dump Radius IPv4 Map
					dnsDumpFlag = true;
					IPGlobal::S1U_PROCESS_ACK = true;
				}

				/* Change the Dump flag in Next Hour */
				if(IPGlobal::CURRENT_HOUR == IPGlobal::DNS_DUMP_HOUR + 1) dnsDumpFlag = false;
			}
			prevHour = curHour;
		} /* End of Hours Job */
	} /* End Of (Main) While Loop */

	/* Dump DNS Lookup Map and Radius Map when System is going Down */

	if(instanceId == 0) {
		lockDnsMap();
			ipSMInterface->IPv4_DnsDumpLkuInfo(IPGlobal::CURRENT_DAY);      // Dump IPv4 DNS Lookup Map
		unLockDnsMap();
	}
	IPGlobal::S1U_SESSION_MANAGER_SHUTDOWN_STATUS[instanceId] = true;

	printf("S1USessionManager [%02d] Shutdown Complete\n", instanceId);
}

