VOID S1USessionManager::processQueue_sm(bool &ip_msg_sm_busy, int &ip_msg_sm_cnt, std::unordered_map<int, MPacket> &ip_msg_sm)
{
	int recCnt = ip_msg_sm_cnt;

	if(recCnt > 0)
	{
		ip_msg_sm_busy = true;
		for(int i=0; i<recCnt; i++)
		{
			IP_ProcessPacket(&ip_msg_sm[i]);
//			ip_msg_sm[i].reset();
			ip_msg_sm.erase(i);
		}
		ip_msg_sm.clear();
		ip_msg_sm_cnt = 0;
		ip_msg_sm_busy = false;
	}
}

VOID S1USessionManager::IP_ProcessPacket(MPacket *msgObj)
{
//	if(!IPGlobal::PACKET_PROCESSING) return;

	switch(msgObj->ipAppProtocol)
	{
			case PACKET_IPPROTO_TCP:
					ipSMInterface->IP_TCPProcessPacket(msgObj);
					break;

			case PACKET_IPPROTO_UDP:
					ipSMInterface->IP_UdpProcessPacket(msgObj);

					switch(msgObj->dnsQRFlag)
					{
						case QUERY:
						case RESPONSE:
									ipSMInterface->IP_DnsProcessPacket(msgObj);
									break;
						default:
									break;
					}
					break;

#ifdef _RADIUS
			case PACKET_IPPROTO_RADIUS:
					radiusSM->IP_RadiusProcessPacket(msgObj);
					break;
#endif

			default:
				break;
	}
}

